import * as React from 'react'
import '../../css/movie_css.css'
import { Rate } from 'antd';

export class MovieItem extends React.Component {

    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div className='box' onClick={this.goDetail} >
                <img className='item_img' src='data:image/jpeg;base64,'alt=''></img>
                <h5>电影名称:{this.props.title} </h5>
                <h5>上映年份:{this.props.year}年</h5>
                <h5>电影类型:{this.props.genres.join(',')}</h5>
                <Rate disabled defaultValue={this.props.rating.average} />
            </div>
        );
    };

    //去详情界面
    goDetail= () =>{
        window.location.href="#/movie/detail/"+this.props.id
    }
};